function Navbar({ onNavigate }) {
    return (
        <nav>
            <a onClick={() => onNavigate('home')}>Home</a>
            <a onClick={() => onNavigate('team')}>Team</a>
            <a onClick={() => onNavigate('conuai')}>ConuAI</a>
            <a onClick={() => onNavigate('quantfund')}>Quant Fund</a>
        </nav>
    );
}

export default Navbar;
